@app.route('/api/user/<string:username>', methods=['GET'])
def get_user(username):
    user = User.query.filter_by(username=username).first()  # For simplicity, get the first user
    if user:
        return jsonify({'user': {'username': user.username, 'name': user.name, 'password':user.password, 'email': user.email, 'picture': user.picture}})
    return jsonify({'user': None})


@app.route('/api/user/<string:username>', methods=['PUT'])
def update_user(username):
    user = User.query.filter_by(username=username).first()
    if user:
        user.username = request.form['username']
        user.name = request.form['name']
        user.password = request.form['password']
        user.email = request.form['email']
        if 'picture' in request.files:
            picture = request.files['picture']
            filename = secure_filename(picture.filename)
            picture_path = os.path.join(app.config['UPLOAD_FOLDER'], filename)
            picture.save(picture_path)
            user.picture = picture_path
        db.session.commit()
        return jsonify({'user': {'username': user.username, 'name': user.name, 'password':user.password, 'email': user.email, 'picture': user.picture}})
    return jsonify({'error': 'User not found'}), 404


@app.route('/api/login', methods=['POST'])
def login():
    if request.is_json:
        print(request)
        data = request.get_json()
        user = User.query.filter_by(username=data['username']).first()
        if user and check_password_hash(user.password, data['password']):
            response = jsonify({'success': True, 'username':data['username']})
            response.headers.add('Access-Control-Allow-Origin', '*')
            return response
        
        response = jsonify({'success': False, 'error': 'Invalid credentials'}), 401
        response[0].headers.add('Access-Control-Allow-Origin', '*')
        return response
    response.headers.add('Access-Control-Allow-Origin', '*')
    response = jsonify({'success': False, 'error': 'Invalid JSON data'}), 400
    
    return response 

@app.route('/api/create-user', methods=['POST'])
def create_user():
    if request.is_json:
        data = request.get_json()
        # TODO: put password hashing on front end, we should receive password as a hash
        hashed_password = generate_password_hash(data['password'], method='scrypt')
        default_picture = os.path.join(app.config['UPLOAD_FOLDER'], 'default_profile_picture.jpg')
        new_user = User(
            username=data['username'],
            password=hashed_password,
            email=data['email'],
            name=data['name'],
            picture=default_picture  # Set the default picture path
        )
        db.session.add(new_user)
        db.session.commit()
        return jsonify({'success': True})
    return jsonify({'success': False, 'error': 'Invalid JSON data'}), 400


@app.route('/api/alert', methods=['GET'])
def get_alerts():
    global uploadCount
    try:
        if uploadCount > 1:
            alerts = Alert.query.with_entities(Alert.id, Alert.name, Alert.description).all()
            alert_list = [{'id': alert.id, 'name': alert.name, 'description': alert.description} for alert in alerts]
        else:
            alert_list = []

        response = jsonify({'alerts': alert_list}), 200
        return response 
    except SQLAlchemyError as e:
        response = jsonify({'error': str(e)}), 400

        return response  

@app.route('/alert/<int:alert_id>', methods=['GET'])
def get_alert(alert_id):
    try:
        alert = Alert.query.get(alert_id)
        if alert:
            alert_data = {
                'id': alert.id,
                'name': alert.name,
                'description': alert.description,
                'machine': alert.machine,
                'occurred_on': alert.occurred_on,
                'severity': alert.severity,
                'program': alert.program
            }
            return jsonify(alert_data), 200
        else:
            return jsonify({'message': 'Alert not found'}), 404
    except SQLAlchemyError as e:
        return jsonify({'message': str(e)}), 500


@app.route('/api/add-alert', methods=['POST'])
def add_alert():
    try:
        data = request.json
        name = data.get('name')
        description = data.get('description')
        machine = data.get('machine')
        occurred_on = data.get('occurred_on')
        severity = data.get('severity')
        program = data.get('program')
        
        if not all([name, description, machine, occurred_on, severity, program]):
            return jsonify({'error': 'Missing required fields'}), 400
        
        occurred_on = datetime.strptime(occurred_on, '%Y-%m-%d %H:%M:%S')
        
        new_alert = Alert(
            name=name,
            description=description,
            machine=machine,
            occurred_on=occurred_on,
            severity=severity,
            program=program
        )
        db.session.add(new_alert)
        db.session.commit()
        
        return jsonify({'message': 'Alert added successfully'}), 201
    except SQLAlchemyError as e:
        db.session.rollback()
        return jsonify({'error': str(e)}), 400
    except Exception as e:
        return jsonify({'error': str(e)}), 400

